import React, { Component } from 'react';
import Feed from '../components/feed';
import Create from './create';
import Footer from './footer';

class FeedContents extends Component {

  constructor(props) {
    super(props);

    this.state = {
      createMode: false,
      images: ['https://d17fnq9dkz9hgj.cloudfront.net/uploads/2020/04/shelter-dog-cropped-1.jpg', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,', 'data:image/jpeg;base64,']
    };
  }

  handleClick = (e) => {
     e.preventDefault();
     let createMode = e.target.value === 'post' ? true : false;
     this.createMode(createMode);
   }

   createMode = (createMode) => {
     this.setState ({
       createMode: createMode
     })
   }

   render() {
     let currentPage;
      if (this.state.createMode) {
        currentPage = <Create />
      } else {
        currentPage = <Feed images={this.state.images} handleClick={this.handleClick.bind(this)} />
      }

      return (
        <div>
           <div className='feed-contents viewport'>
            {currentPage}
           </div>
           <div>
             <Footer handleClick={this.handleClick.bind(this)}/>
           </div>
       </div>
      )
   }
}

export default FeedContents;
